  \"Occurrence and Habitat Use of Wintering Bald Eagles on Eastern Lake Ontario and
  the St. Lawrence River (1955-1993)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:12.865055\",\n\t\"name\": \"occurrence-and-habitat-use-of-wintering-bald-eagles-on-eastern-lake-ontario-and-the-s-1955\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Occurrence and habitat use data for bald
  eagles (Haliaeetus leucocephalus), was compiled for use in planning a study to assess
  the potential effects of environmental contaminants on the health and reproductive
  fitness of this species in the International section of the St. Lawrence River (SLR).
  Records of wintering bald eagles sighted along the SLR and eastern Lake Ontario
  from 1955 to 1993 were collated from the files of American and Canadian federal,
  state, and provincial agencies, private groups, and individuals. Sighting records
  included aerial surveys (1979-1993), ground surveys (1977-1992), and additional
  sighting records (1955-1993). Records were partitioned into 16 fields and entered
  into an electronic database. Behavioral data were included in 571 records, including
  eagles in flight (N=197), perched (N=298), and feeding (N=74). Perch sites included
  on the ice (N=101), in coniferous trees (N=67), and in deciduous trees (N=73). Prey
  items included mammals (N=29), fish (N=11), and birds (N=6). Approximately 30% of
  records include latitude and longitude coordinates. Due to observer effort and location
  bias in the overall database, these data should be interpreted cautiously. Additional
  data may exist and can be entered into the database as they become available.\",\n\t\"license_title\":
